import { createRouter, createWebHistory } from 'vue-router'
import App from './../App.vue'
import AuthorizationFromServices from './../components/Auth/AuthorizationFromervices'

const routes = [
    {
        path:'/',
        name:'Authorization',
        component: App,
    },
    {
        path: 'code',
        name: 'AuthorizationFromServices', 
        component: AuthorizationFromServices
    }
    
];

const router = createRouter({
    history: createWebHistory(),
    routes,
});
export default router;
